function generateListItems(texts, svgs) {
    let listItems = '';
    for (let i = 0; i < texts.length; i++) {
        listItems += `
            <li class="menu-item${i === 0 ? ' active' : ''}">
                <a href="service-details.html" class="d-flex align-items-center justify-content-between" onclick="event.preventDefault();">
                    <span>
                        ${svgs[i]} <!-- Insert SVG from array -->
                        <span class="menu-text">${texts[i]}</span>
            </span>
                    <i class="bi bi-chevron-right"></i>
                </a>
            </li>
        `;
    }
    return listItems;
}

