function getContentBasedOnMenu(menu) {
    // This is just a placeholder. Replace this with actual logic to get content based on menu
    var content = '';
    switch (menu) {
        case 'Tourist Visa Processing':
            content = `Navigating the process of obtaining a tourist visa can be overwhelming, but at Spartan Immigration Services, we're here to simplify the journey. Our expert team will guide you through each step of the application process, ensuring that your paperwork is in order and that you have everything you need for a successful application. Whether you're planning a short vacation or an extended stay, we'll help you secure the necessary visa with ease.`;
            break;
        case 'Family Sponsorship':
            content = `Bringing your loved ones to Canada is a top priority, and Spartan Immigration Services is here to help make it happen. Our family sponsorship experts will assist you in navigating the complex sponsorship process, ensuring that your application is completed accurately and efficiently. From spouses to children to parents, we'll help reunite you with your family members in Canada, every step of the way.`;
            break;
        case 'Provincial Nominee Program (PNP)':
            content = `Looking to immigrate to a specific province in Canada? The Provincial Nominee Program (PNP) may be the pathway for you. Our team at Spartan Immigration Services is well-versed in the various provincial nominee programs across Canada and can help you determine your eligibility and navigate the application process. Whether you're interested in the Ontario Immigrant Nominee Program (OINP), the British Columbia Provincial Nominee Program (BC PNP), or any other PNP stream, we're here to guide you toward your goal of Canadian permanent residency.`;
            break;
        case 'Study Permit':
            content = `Canada is home to world-class educational institutions, and obtaining a study permit is the first step toward pursuing your academic dreams in this country. At Spartan Immigration Services, we specialize in assisting international students with their study permit applications. From gathering the necessary documentation to navigating the visa process, our team will support you every step of the way as you embark on your educational journey in Canada.`;
            break;
        case 'Express Entry':
            content = `The Express Entry system is a fast-track pathway to Canadian permanent residency for skilled workers. At Spartan Immigration Services, we understand the nuances of the Express Entry system and can help you maximize your chances of success. Whether you're applying under the Federal Skilled Worker Program (FSWP), the Canadian Experience Class (CEC), or the Federal Skilled Trades Program (FSTP), our experienced team will guide you through the application process with precision and expertise.`;
            break;
        case 'Work Permit':
            content = `Securing a work permit is essential for those looking to gain employment in Canada. Spartan Immigration Services specializes in assisting individuals with their work permit applications, whether they're seeking temporary employment, a job offer-based permit, or an open work permit. Our team will ensure that your application is completed accurately and efficiently, so you can start working in Canada as soon as possible.`;
            break;
        case 'Visitor Visa':
            content = `Planning a visit to Canada? A visitor visa is essential for individuals who wish to travel to Canada for tourism, visiting family and friends, or attending business meetings. Spartan Immigration Services can help you obtain your visitor visa with ease. Our team will guide you through the application process, ensuring that you have all the necessary documentation and meeting the requirements for a successful visa application.`;
            break;
        case 'Citizenship Applications':
            content = `Becoming a Canadian citizen is a significant milestone in your immigration journey. Spartan Immigration Services is here to assist you with your citizenship application every step of the way. Whether you're applying for citizenship through naturalization or through descent, our team will ensure that your application is completed accurately and efficiently, so you can enjoy all the rights and privileges of Canadian citizenship.`;
            break;
        case 'Spouse/Parents Sponsorship':
            content = `Reuniting with your spouse or parents in Canada is a top priority for many immigrants. Spartan Immigration Services specializes in spouse and parent sponsorship applications, helping families navigate the complex immigration process with ease. Our team will guide you through each step of the sponsorship process, ensuring that your application is completed accurately and efficiently, so you can be reunited with your loved ones as soon as possible.`;
            break;
        case 'PR Card Renewal':
            content = `Maintaining your permanent resident status in Canada is essential, and renewing your Permanent Resident (PR) card is a crucial step in the process. Spartan Immigration Services can assist you with your PR card renewal, ensuring that your application is completed accurately and submitted on time. Our team will guide you through the renewal process, helping you navigate any challenges that may arise along the way.`;
            break;
        default:
            content = 'Default content';
    }
    return content;
}

